Court finds State has complied with victim notification.  Sentencing hearing proceeded.  Statements made as to sentencing.

AS TO COUNT 1: 
The Court sentenced the defendant to a MAXIMUM TERM OF IMPRISONMENT of 27 MONTHS (CONSECUTIVE TO COUNTS 2 & 3), with credit for 0 days time served; the INITIAL TERM OF CONFINEMENT in the Wisconsin State Prison System is 15 MONTHS; the MAXIMUM TERM OF EXTENDED SUPERVISION is 12 MONTHS. 

The defendant IS NOT eligible for the Challenge Incarceration Program and IS NOT eligible for the "Wisconsin Substance Abuse Program". 

AS TO COUNT 2:
The court sentenced the defendant to 5 MONTHS in the House of Correction (CONCURRENT TO COUNT 3), with credit for 123 DAYS time served.  

AS TO COUNT 3:
The court sentenced the defendant to 90 DAYS in the House of Correction (CONCURRENT TO COUNT 2), with credit for 123 DAYS time served.  

AS TO COUNT 1 ONLY:
Court STAYED sentence and placed defendant on PROBATION for 2 YEARS.
CONDITIONS OF PROBATION:
-Serve 60 DAYS in the House of Correction as Condition Time (as to COUNT 1), STAYED pending review;
-Batterers Intervention program;
-Mental health evaluation, comply with recommended treatment;
-AODA assessment, comply with recommended treatment;
-Treatment and/or counseling as determined by agent;
-Absolute sobriety;
-No contact with victim M.T. unless approved by the Court;
-Obtain/maintain employment;
-No contact with firearms;
-Provide DNA sample;
-Court WAIVES all non-mandatory court costs and fees;
-Pay all supervision fees, court costs, fees, and surcharges including: DNA & DV surcharges during period of probation.  Unpaid amount to convert to a civil judgment.

*Court advised defendant of right to seek post conviction relief.
*Court advised that under 18 USC Section 922(g)(9) the defendant is prohibited from possession of a firearm and/or ammunition after conviction of a crime of domestic violence.
*Court advised due to felony conviction the defendant is prohibited from firearm possession, and defendant's voting rights are suspended and may not vote until civil rights are restored. 

Filed: 
Memorandum of Conditions of Probation;
Written Explanation of Determinate Sentence;
Notice of Right to Seek Post-Conviction Relief;
Ineligible Voting Notice and Acknowledgement.

Probation Review Hearing in Branch 35.

Parties are advised that effective August 1, 2022 this case will be assigned to Judge Audrey Skwierawski, Branch 41 in Room 501 of the Courthouse.
